import React, { Component } from 'react';

export default class Users extends Component {
 
    delete = (id)  => {
        console.log(id)
    }

  render()
 
   {
     const {id,name,lastname,email} = this.props.kategori;
    return (
      <div>
        <table className='bg-dark text-white w-75 m-auto mt-5 '>
          <thead className='p-5'>
            <tr>
              <th scope='col'>İD</th>
              <th scope='col'>NAME</th>
              <th scope='col'>LAST-NAME</th>
              <th scope='col'>E-MAİL</th>
            </tr>
          </thead>

          <tbody>
           
              <tr >
                <td>{id}</td>
                <td>{name}</td>
                <td>{lastname}</td>
                <td>{email}</td>
                <td>
                    <button className='btn btn-danger mb-2' onClick={this.delete(id)}>Delete</button>
                </td>
              </tr>
            
          </tbody>
        </table>
      </div>
    );
  }
}
